import React from "react";

const WorkCard = () => {
  return (
    <div className="w-[300px] h-[200px]">
      {/* Project Screenshot  */}
      <div className="w-full h-1/2 bg-red-800"></div>

      {/* Project Info  */}

      <div className="w-full h-1/2 bg-slate-500">
        <div>
          <h3> Project Name</h3>
        </div>
      </div>
    </div>
  );
};

export default WorkCard;
